import React from 'react';

const Filters = () => {

    return(
        <div className="filters">
            <div className="tags"></div>
            <div className="color"></div>
            <div className="timeframe"></div>
            <div className="made-with"></div>
            <div className="downloads"></div>
        </div>
    )

}

export default Filters;
